import 'package:json_annotation/json_annotation.dart';part 'feedback_md.g.dart';@JsonSerializable(anyMap: true)class FeedbackMd {  String id;  String userId;  String userProfileId;  String feedback;  int rating;  String createdAt;  @override  FeedbackMd({    required this.id,    required this.userId,    required this.userProfileId,    required this.feedback,    required this.rating,    required this.createdAt,  });  factory FeedbackMd.fromJson(Map json) => _$FeedbackMdFromJson(json);  Map toJson() => _$FeedbackMdToJson(this);}